import React from "react";

import { MyUsers } from "../data/users";
import { UserProps } from "../data/interfaces";

const MapDatas = MyUsers.map((data: UserProps, index) =>
    <li key={`el-${index}`}>
        <p>{data.name}</p>
        <p>{data.last_name}</p>
        <p>{data.city}</p>
        <p>{data.country}</p>
        <p>{data.books}</p>
    </li>
);

export default MapDatas;


export default function Image(props) {
    return (
        <div className="imageBlock">
            <img src={props.url} alt={'image-' + props.imgId} />
            <p className="imageDetail"><span>{props.imgId}</span> {props.imgDesc}</p>
        </div>
    )   
  }
